Fetch mongo documents based on multiple fields<p>Given mongo document of the following form in a collection:</p>

<pre><code>{
  "_id":"ObjectId",
  "value":{
    "id": 1,
     "payment": [
       {
        "status": {
           "id": "1.1",
           "value": "Paid"
         }
      },
      {
       "status": {
           "id": "1.2",
           "value": "Scheduled"
        }
      },
      {
      "status": {
          "id": "1.3",
          "value": "Recorded"
       }
      }
    ]
  }
}
</code></pre>

<p><code>ids = [1,2,3,4]</code></p>

<p>How can i fetch all documents having <code>id</code> in <code>ids</code> and at least one of <code>payments.status.value</code> equal to <code>Scheduled</code> state ?</p>

<p>I am using the following query but it's returning 0 records,</p>

<pre><code>db.collectionName.find({$and:[{"value.id":{$in:ids}},{"value.payment.status.value":"Scheduled"}]})`
</code></pre>

