Build a filter on same node<p>I have a problem where I need to apply a filter to an Object in my database.
Here's an example:</p>

<pre><code>"Object": {
    "Properties" : [ 
                {
                    "Key" : "Date",
                    "Value" : "9/12/2017"
                }, 
                {
                    "Key" : "Primary Location",
                    "Value" : "Moon"
                }, 
                {
                    "Key" : "Requested By",
                    "Value" : "drei"
                }, 
                {
                    "Key" : "Secondary Location",
                    "Value" : "Canada"
                }
    ]
}
</code></pre>

<p>Say I want to find any Object where "Primary Location" is "Canada"... I can't seem to figure out how to do this. Here's my attempt:</p>

<pre><code>var builder = Builders&lt;Object&gt;.Filter;
FilterDefinition&lt;Object&gt; filter = builder.And(
                 builder.Eq("Properties.Key", "Primary Location"),
                 builder.Eq("Properties.Value", "Canada"));
</code></pre>

<p>Essentially I'm using an And Builder for the Key and Value, however this doesn't group them together to perform the filter. It sees that there is a Key with "Primary Location" and that there is also a Value with "Canada" in the Properties 
and will return the above Object.</p>

<p>How should I write my filter to filter on the same Value and the Key pair?</p>

