MongoDB too slow when using both $gte and $lte in PHP Laravel<p>I am using MongoDB for first time in my project and now I am facing a big challenge. This project is used to store huge amount of log data and now we already collected 8 million records.I am using Laravel MongoDB library created by jenssegers. </p>

<p>Here are the details of challenges I am facing with MongoDB.</p>

<p>I need to display the logs in a table with pagination for a specific network type collected within a certain range of time. To have pagination I need to know the total count of filtered records. But unfortunately <strong>the selective count is extremely slow in MongoDB</strong>.</p>

<p>Here is the code I used for selective count</p>

<pre><code>$start_time = new \MongoDB\BSON\UTCDateTime(strtotime($fromDate)* 1000);
$end_time = new \MongoDB\BSON\UTCDateTime(strtotime($tillDate)* 1000);

$totalData = Location::raw(function($collection) use($network_id, $start_time, $end_time) {
                        return $collection-&gt;count(["network_id" =&gt; $network_id],['created_at' =&gt; array('$gt' =&gt; $start_time, '$lt' =&gt; $end_time)]);
                });
</code></pre>

<p>Now the second and most important challenge I am facing is <strong>MongoDB too slow when using both $gte and $lte</strong>. If i use only one ie $lte or $gte I get results instantly. But if i used both, Then it is extremely slow.</p>

<p>Here is code I used to get logs between certain date range</p>

<pre><code>    $locations = Location::query();

    if (! empty($network_id)) {
        $locations = $locations-&gt;where('network_id', $network_id);
    }

    if ($hour != null) {
        $locations =  $locations-&gt;where('created_at','&gt;=',$start_time)
                                -&gt;where('created_at','&lt;=',$end_time);
    } 

    $locations =  $locations-&gt;offset($start)
                            -&gt;limit(1000)
                            -&gt;orderBy('_id','DESC')
                            -&gt;get();
</code></pre>

<p>Here is my live server details,
I am hosted it on AWS on 1 core Intel(R) Xeon(R) CPU E5-2676 v3 @ 2.40GHz with 1gb ram and 4gb swap memory.</p>

<p>If anybody has previous experience with these situation please help me.</p>

