I have another issue that when the search (filter) cannot find any data in the content, it is stuck then I have to enter from the input box to initial search again.</p>

<p>The following attached image show that I search 111, if I delete it to 11 it is still working fine, but if I search 11111 it show nothing and after delete 11111 to 111 it still show nothing so I have to enter to start new search.
