<p>After debugging from console I found that</p>

<ul>
<li>this.state.holder (original temp is ok)</li>
<li>this.state.issues (filtered content is ok)</li>
<li>But this.state.pageOfItems (after it is empty, then nothing show)</li>
</ul>

<p>Could anybody please help to check my code?</p>

<p>Note: I use the pagination from <a href="http://jasonwatmore.com/post/2017/03/14/react-pagination-example-with-logic-like-google" rel="nofollow noreferrer">http://jasonwatmore.com/post/2017/03/14/react-pagination-example-with-logic-like-google</a></p>

<p>IssueList.js</p>

<pre><code>import React, { Component } from 'react';
import PropTypes from 'prop-types';
import 'whatwg-fetch';
import Pagination from '../components/Pagination';
import IssueAdd from '../components/IssueAdd';

class IssueList extends Component {

  constructor(props) {
    super(props);

    this.state = {
        issues: [],
        holder: [],
        pageOfItems: [],
    };


    this.createIssue = this.createIssue.bind(this);
    this.onChangePage = this.onChangePage.bind(this);
    this.filterList = this.filterList.bind(this);
  }
  componentDidMount() {
    this.loadData();
  }

  //componentDidUpdate(prevProps) {
  //    this.loadData();
  //}
  // Load all new database after changed

  loadData() {
    fetch('/api/issues').then(response =&gt; {
      if (response.ok) {
        response.json().then(data =&gt; {
          data.records.forEach(issue =&gt; {
            issue.created = new Date(issue.created);
            if (issue.completionDate) {
              issue.completionDate = new Date(issue.completionDate);
            }
          });
          this.setState({ issues: data.records, holder: data.records });
        });
      } else {
        response.json().then(error =&gt; {
          alert(`Failed to fetch issues ${error.message}`);
        });
      }
    }).catch(err =&gt; {
      alert(`Error in fetching data from server: ${err}`);
    });
  }

  createIssue(newIssue) {
    fetch('/api/issues', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newIssue),
    }).then(response =&gt; {
      if (response.ok) {
        response.json().then(updatedIssue =&gt; {
          updatedIssue.created = new Date(updatedIssue.created);
          if (updatedIssue.completionDate) {
            updatedIssue.completionDate = new Date(updatedIssue.completionDate);
          }
          const newIssues = this.state.issues.concat(updatedIssue);
          this.setState({ issues: newIssues });
        });
      } else {
        response.json().then(error =&gt; {
          alert(`Failed to add issue: ${error.message}`);
        });
      }
    }).catch(err =&gt; {
      alert(`Error in sending data to server: ${err.message}`);
    });
  }

  onChangePage(pageOfItems) {
    this.setState({ pageOfItems: pageOfItems });
  }

  filterList = (e) =&gt; {
    let { value } = e.target;
    this.setState({ value }, () =&gt; {
        var searchValue = this.state.value.toLowerCase();
        var updatedList = this.state.holder;
        updatedList = updatedList.filter((item) =&gt; {
            return Object.keys(item).some(key =&gt; item[key].toString().toLowerCase().search(searchValue) !== -1);
        });
        this.setState({ issues: updatedList });
    });
  }

  render() {
    return (
      &lt;div&gt;
        &lt;h1&gt;Issue Tracker&lt;/h1&gt;
        &lt;hr /&gt;
        &lt;div className="filter-list"&gt;
